

/*------------------------------------------------------------------------------
 * NAME       : Gamma Function
 * PURPOSE    : Finds the value of the gamma function at DF/2
 * PARAMETERS : DF (degrees of freedom
 * RETURNS    : Î“(DF/2)
 *----------------------------------------------------------------------------*/

function Gamma(DF){
    if(DF > 200){alert("Degrees of Freedom is greater 200"); return;}
    var n = DF;  //degrees of freedom 
    var Pi = 3.14159265358979;
    var SqrtPi = Math.sqrt(3.14159265358979);
 
    if(DF == 1){
       return SqrtPi;
    }                 
    else if(DF == 2){
       return 1.0;
    }	      
    else{ 
       if((DF % 2) == 0){  //even n
           var kk = parseInt(DF/2);
           if(kk <= 100){
              var jj = kk - 1;
              return factorial100(jj);
            }
       }             
       else{  //odd n
          var kk = parseInt(DF/2 - 0.5);
          var kk2 = parseInt(2*kk);
          var val1 = factorial100(kk);
          var val2 = factorial100(kk2);
          var val3 = Math.pow(2,kk2);
          var val = (val2/(val3*val1))*SqrtPi;
          return val;
       }
    }
}


